import React from 'react'
import styled from "styled-components";

const Holding = () => {
    const Holdingsection = styled.section`
    
    `;


  return (
    <Holdingsection>
        <TableContainer className="tableContainer" component={Paper}>
            <Table sx={{ minWidth: 650 }} aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell>Large Cap 50%</TableCell>
                  <TableCell align="right">Mid Cap 50%</TableCell>
                  <TableCell align="right">Small Cap 50%</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rows.map((row) => (
                  <TableRow
                    key={row.name}
                    sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                  >
                    <TableCell  scope="row">
                      {row.large}
                    </TableCell>
                    <TableCell align="right">{row.mid}</TableCell>
                    <TableCell align="right">{row.small}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
    </Holdingsection>
  )
}

export default Holding
